import React, {Component} from 'react';
import {Button, Result} from "antd";


class Results extends Component {
    render() {
        return (
            <Result status={this.props.statu} title='注册成功！' subTitle='恭喜您，已成功注册为飞云企业用户！我们将为您提供优质服务！您可以登录了。'
                    extra={[<Button type='link'>立即登录</Button>]}/>
        );
    }
}

export default Results;
